function Card (props) {

    console.log(props)


    return <div>

        <div className="card">
            <div className="top">
                <Id id = {props.identifier} />
                <h2 className = "name">{props.name}</h2>
                <Profile pic = {props.img} />
            </div>

            <div className="bottom info" >
                <Details info = {props.phoneNumber} />
                <Details info = {props.email} />
            </div>
      </div>
    </div>
}

export default Card
